    function _pickWinner() private{
            
        Round memory winner = rounds[RoundId-1];

        uint countJackpots2 = 0 ;
        uint countJackpots1 = 0 ;
        
        for(uint n = 0 ; n < tickets.length; n++){
         uint count =0;
