                        TotalJP1 = TotalJP1 - jackpot1 ;
                        emit  Win(tickets[m].id ,tickets[m].player, tickets[m].win ,tickets[m].prize);
                    }
                        
                }
            }
        }



        TotalTicket = 0 ;
        
        _startNewRound();
}
    
    
